// 当前 host
var HOST = window.location.host;

// 开发
var DEV = 'DEV';

// 生产
var PROD = 'PROD';

// ******************* 不使用Nginx反向代理时 ********************
// 当前环境
var ENV = HOST === 'localhost:9000' ? DEV : PROD;
// 基础地址
var BASE_URL = ENV === DEV ? 'http://localhost:58080' : 'http://localhost:58080';
// ***********************************************************

// ******************* 使用Nginx反向代理时 *********************
