// ***********************************************************

// ******************* 静态资源路径 ****************************
var STATIC_PATH = ENV === DEV ? '/static/' : '/static/';
// ***********************************************************

// 接口地址
var API_URL = BASE_URL + '/';

// 分页大小
var PAGE_SIZE = 10;

// 网站标题
var TITLE = 'JEasy Admin系统';
var FORM_CONTENT_TYPE = 'application/x-www-form-urlencoded;charset=UTF-8';
var JSON_CONTENT_TYPE = 'application/json;charset=UTF-8';
export default {
  BASE_URL: BASE_URL,
  API_URL: API_URL,
  PAGE_SIZE: PAGE_SIZE,
  TITLE: TITLE,
  STATIC_PATH: STATIC_PATH,
  FORM_CONTENT_TYPE: FORM_CONTENT_TYPE,
  JSON_CONTENT_TYPE: JSON_CONTENT_TYPE
};
